The very best of Tommy Cooper:

Op 15 april 1984 stierf Tommy Cooper.Tijdens een optreden in Her Majesty's Theatre in Londen zakte hij tijdens een live televisie in elkaar. Terwijl de gordijnen zich om hem sloten, dachten vele 
kijkers dat het bij zijn act hoorde. Incompetentie was namelijk een vast onderdeel van zijn acts en bestond uit het feit dat hij het publiek wilde laten geloven dat hij geen idee had wat zou volgen.
Op deze DVD kunt u nog eens genieten van de beste sketches en hilarische goocheltrucs van deze uitzonderlijke komiek.


